import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import SignUpPage from './pages/SignUpPage';
import ProfilePage from './pages/ProfilePage';
import RideHistoryPage from './pages/RideHistoryPage';
import PaymentPage from './pages/PaymentPage';
import BookingPage from './pages/BookingPage';
import DriverDashboardPage from './pages/DriverDashboardPage';
import SettingsPage from './pages/SettingsPage';
import AdminDashboardPage from './pages/AdminDashboardPage';
import FareManagementPage from './pages/FareManagementPage';
import CashPaymentPage from './pages/CashPaymentPage';
import SplitFarePage from './pages/SplitFarePage';
import RoyaltyRewardsPage from './pages/RoyaltyRewardsPage';
import RideSharingPage from './pages/RideSharingPage';
import DriverRatingPage from './pages/DriverRatingPage';
import ScheduleRidesPage from './pages/ScheduleRidesPage';
import VehicleSelectionPage from './pages/VehicleSelectionPage';
import UberPoolPage from './pages/UberPoolPage';
import FareCalculatorPage from './pages/FareCalculatorPage';
import RouteSelectionPage from './pages/RouteSelectionPage';
import ETAPage from './pages/ETAPage';
import PushNotificationsPage from './pages/PushNotificationsPage';
import MultipleDestinationsPage from './pages/MultipleDestinationsPage';
import EmergencyAssistancePage from './pages/EmergencyAssistancePage';
import TrustedContactsPage from './pages/TrustedContactsPage';
import RealTimeIDCheckPage from './pages/RealTimeIDCheckPage';
import SpeedLimitAlertsPage from './pages/SpeedLimitAlertsPage';
import CustomerSupportPage from './pages/CustomerSupportPage';
import UberEatsIntegrationPage from './pages/UberEatsIntegrationPage';
import UberForBusinessPage from './pages/UberForBusinessPage';
import RewardsLoyaltyProgramsPage from './pages/RewardsLoyaltyProgramsPage';
import DashboardPage from './pages/DashboardPage';
import NavBar from './components/NavBar';
import './App.css'; // Import global styles

function App() {
    console.log('App component rendered');
    return (
        <Router>
            <div className="App">
                <NavBar /> {/* Add navigation bar */}
                <Routes>
                    <Route path="/" exact element={<HomePage />} />
                    <Route path="/login" element={<LoginPage />} />
                    <Route path="/signup" element={<SignUpPage />} />
                    <Route path="/profile" element={<ProfilePage />} />
                    <Route path="/ride-history" element={<RideHistoryPage />} />
                    <Route path="/payment" element={<PaymentPage />} />
                    <Route path="/booking" element={<BookingPage />} />
                    <Route path="/driver-dashboard" element={<DriverDashboardPage />} />
                    <Route path="/settings" element={<SettingsPage />} />
                    <Route path="/admin-dashboard" element={<AdminDashboardPage />} />
                    <Route path="/fare-management" element={<FareManagementPage />} />
                    <Route path="/cash-payment" element={<CashPaymentPage />} />
                    <Route path="/split-fare" element={<SplitFarePage />} />
                    <Route path="/royalty-rewards" element={<RoyaltyRewardsPage />} />
                    <Route path="/ride-sharing" element={<RideSharingPage />} />
                    <Route path="/driver-rating" element={<DriverRatingPage />} />
                    <Route path="/schedule-rides" element={<ScheduleRidesPage />} />
                    <Route path="/vehicle-selection" element={<VehicleSelectionPage />} />
                    <Route path="/uber-pool" element={<UberPoolPage />} />
                    <Route path="/fare-calculator" element={<FareCalculatorPage />} />
                    <Route path="/route-selection" element={<RouteSelectionPage />} />
                    <Route path="/eta" element={<ETAPage />} />
                    <Route path="/push-notifications" element={<PushNotificationsPage />} />
                    <Route path="/multiple-destinations" element={<MultipleDestinationsPage />} />
                    <Route path="/emergency-assistance" element={<EmergencyAssistancePage />} />
                    <Route path="/trusted-contacts" element={<TrustedContactsPage />} />
                    <Route path="/real-time-id-check" element={<RealTimeIDCheckPage />} />
                    <Route path="/speed-limit-alerts" element={<SpeedLimitAlertsPage />} />
                    <Route path="/customer-support" element={<CustomerSupportPage />} />
                    <Route path="/uber-eats-integration" element={<UberEatsIntegrationPage />} />
                    <Route path="/uber-for-business" element={<UberForBusinessPage />} />
                    <Route path="/rewards-loyalty-programs" element={<RewardsLoyaltyProgramsPage />} />
                    <Route path="/dashboard" element={<DashboardPage />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
